import React from "react";


const ForgotPassword = () => {


    return (

        <div className="login_form-wrapper">
            <h2 className='login_header'>Welcome back!</h2>
            <p className='login_subtext'>Sign in and get to it.</p>
            <label htmlFor="email">Email</label>
            <input className='login-field_email'
                   type="email"
                   id="email" name="email"
                   placeholder="Email Address"
            />
            <button className='login-button_submit' type="submit">
                Sign In
            </button>
        </div>

    )
};

export default ForgotPassword;
